import React from 'react';
import { useDispatch, useSelector } from 'react-redux';

function OrderProduct() {

    const {orderProducts} = useSelector(state => state.userReducer);
    const dispatch = useDispatch();

    return (
        <div>
            <table>
                <thead>
                    <tr>
                        <th>t/r</th>
                        <th>name</th>
                        <th>amount</th>
                        <th>price</th>
                        <th>actions</th>
                    </tr>
                </thead>
                <tbody>
                    {
                        orderProducts.map(order=> <tr>
                            <td>{order.id}</td>
                            <td>{order.name}</td>
                            <td>{order.amount}</td>
                            <td><button className='btn btn-warning mx-1'>+</button>{order.price} <button className='btn btn-warning mx-1'>-</button> </td>
                            <td>
                                <button></button>
                            </td>
                        </tr>)
                    }
                </tbody>
            </table>
        </div>
    );
}

export default OrderProduct;
